　食器洗い乾燥機ＯＫのお箸・フォーク・スプーンとケースのセットです。<br>
ケースは、指で引き出すスライド式で、衝撃に強く丈夫な構造です。<br>
また、洗いやすく分解可能になっています。<br>
おハシには名前を入れられるスペース付き。<br>
<br>
ケース用の名前シールも付いてます。<br>
<br>
■商品サイズ<br>
・ケースサイズ：206×82×17mm<br>
・箸の長さ：16.5cm<br>
・スプーン、フォーク：全長13cm<br>
<br>
