　ドラゴンボール超の仲間たちが大集合した楽しいトリオセット☆<br>
カチャカチャ音が鳴らず、お子様の持ち運びも<br>
ラクラクの軽量タイプが登場しました。<br>
ケースはスライド式で壊れにくく、食洗機対応で清潔に使うことができます。<br>
<br>
【サイズ】<br>
・ケース：約198×76×17ｍｍ<br>
・箸サイズ：16.5ｃｍ<br>
・スプーン・フォーク：13ｃｍ<br>
<br>
【仕様】<br>
